import React from 'react';

import { Container } from './styles';
import logo from '../../assets/logo.svg';

export default function Header() {
  return (
    <Container>
      <nav>
        <img src={logo} />
        <text>Header</text>
        <text>Header</text>
        <text>Header</text>
      </nav>
    </Container>
  );
}
